import React from "react";
import PopupWithForm from "./PopupWithForm";

function ConfirmPopup(props) {
  return (
    <PopupWithForm
      name="popup_confirm"
      title="Вы уверены?"
      buttonSaveText="Да"
      isOpen={props.isOpen}
      onClose={props.onClose}
    />
  );
}
export default ConfirmPopup;
